import React from 'react'
import { Container } from "react-bootstrap";
import Header from "./components/Header";

const App = () => {
  return (
    // Add Header component to App
    <>
      <Header />

      <main className="py-3">
        <Container>
          <h1>where pros shop</h1>
        </Container>
      </main>
    </>
  );
}

export default App
